import Head from "next/head";
import { ShopContext } from "../context/shopContext";

const Contact = () => {
  const { products, fetchBySearch } = React.useContext(ShopContext);

  React.useEffect(() => {
    const query = "bottoms";
    fetchBySearch(query);
    return () => {};
  }, [fetchBySearch]);

  // map through products
  // if search query matches (use regex) the title or product type

  return (
    <div>
      <Head>
        <title>OJOS | Search</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <form type="search" className="search-form">
        <input type="text" placeholder="Search" className="search-form-input" />
        <button type="submit" className="search-form-input-button">
          Go
        </button>
      </form>
    </div>
  );
};

export default Contact;
